import React, { useEffect, useState } from 'react';
import { getWisata, deleteWisata } from '../../api';
import { Link, useNavigate } from 'react-router-dom';

const ManajemenWisata = () => {
    const [wisataList, setWisataList] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        fetchWisata();
    }, []);

    const fetchWisata = async () => {
        const data = await getWisata();
        setWisataList(data);
    };

    const handleDelete = async (id) => {
        if (window.confirm("Yakin ingin menghapus data ini?")) {
            await deleteWisata(id);
            fetchWisata();
        }
    };

    return (
        <div className="container mt-5 pt-5">
            <h2>Manajemen Wisata</h2>
            <Link to="/admin/tambah-wisata" className="btn btn-success mb-3">Tambah Wisata</Link>
            <table className="table table-bordered">
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Nama</th>
                        <th>Aksi</th>
                    </tr>
                </thead>
                <tbody>
                    {wisataList.map((wisata) => (
                        <tr key={wisata.id}>
                            <td>{wisata.id}</td>
                            <td>{wisata.nama}</td>
                            <td>
                                <button onClick={() => navigate(`/admin/edit-wisata/${wisata.id}`)} className="btn btn-warning btn-sm me-2">Edit</button>
                                <button onClick={() => handleDelete(wisata.id)} className="btn btn-danger btn-sm">Hapus</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default ManajemenWisata;
